window.bookSummaryJSON = "<p><b>If you come after the CIA’s most feared assassin, there’s one cardinal rule: Don’t miss.</b></p> <p>America is under attack. Thousands lie dead after simultaneous strikes across the country. The day will come to be known as Bloody Monday.</p> <p>Jason Trapp, codename ‘Hangman’, was a covert operative whose feats became the stuff of legend. He was the tip of the spear—the man his country unleashed when all hope was lost.</p> <p>Six months ago, someone sold him out. The Agency listed him as killed in action. He lost everything—and everyone—he held dear. But Trapp’s not that easy to kill. As his country reels from the deadliest terrorist attacks it has ever witnessed, Trapp’s personal vendetta leads him right back to where he started: duty to his country. The violence, the terror, the assassination of his partner… It’s all connected.</p> <p><b>And now the Hangman is coming for the guilty.</b></p> <p>\"Fans of Ryan, Reacher and Bourne will love betrayed CIA operative Jason Trapp, who stars in a pulse-pounding revenge thriller in 2019's breakout hit.\"</p> <p>Note: <i>Dark State</i> was previously published as <i>Deep State</i>.</p>"; 
